DROP TABLE pai_ref_insee_pays;
CREATE TABLE pai_ref_insee_pays(
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  code varchar(3) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' NOT NULL,
  pays varchar(64) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' NOT NULL,
  capital varchar(64) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' NULL,
  nationalite varchar(64) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' NULL,
  iso2 varchar(2) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' NULL,
  iso3 varchar(3) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' NULL,
  ue_ varchar(1) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' DEFAULT 'N' NOT NULL, 
  eee_ varchar(1) CHARACTER SET 'utf8' COLLATE 'utf8_unicode_ci' DEFAULT 'N' NOT NULL, 
  ue TINYINT(1) DEFAULT 0 NOT NULL, 
  eee TINYINT(1) DEFAULT 0 NOT NULL, 
  UNIQUE INDEX pai_pai_ref_insee_pays_uk (`code` ASC),
  CONSTRAINT pai_pai_ref_insee_pays_pk PRIMARY KEY (id)
  )
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8
COLLATE = utf8_unicode_ci;

update pai_ref_insee_pays set ue=1 where ue_='O';
update pai_ref_insee_pays set eee=1 where eee_='O';
select * from pai_ref_insee_pays where ue=1;
select * from pai_ref_insee_pays where eee=1;
select * from pai_ref_insee_pays;
alter table pai_ref_insee_pays drop eee_;
alter table pai_ref_insee_pays drop ue_;
   
